import React from "react";

export default class Test extends React.Component {
  state = {
    loading: true,
    form: null
  };

  async componentDidMount() {
    const url = "http://192.168.1.245:8095/updatemonthvalue";
    const response = await fetch(url);
    const data = await response.json();
    this.setState({ form: data[0], loading: false });
  }











  render() {
    if (this.state.loading) {
      return <div>loading...</div>;
    }

    if (!this.state.form) {
      return <div>didn't get a person</div>;
    }
    return (
      <div>
        <div>{this.state.form.name.title}</div>
        <div>{this.state.form.name.first}</div>
        <div>{this.state.form.name.last}</div>
        <img src={this.state.form.picture.large} />
      </div>
    );
  }
}
